  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Pishkun, Willow
  Creek, and Benton Lake National Wildlife Refuges outlines Refuge accomplishments
  from January through April of 1954. The report begins by summarizing the weather
  conditions and water conditions during this period. Wildlife- including migratory
  birds, upland game birds, big game animals, furbearers, predators, rodents, and
  fish- is also covered. The Refuge development and maintenance section discusses
  physical developments. Resource management is outlined; topics include grazing and
  haying. A progress report on field investigations and applied research is also provided.\",\n\t\"license_title\":
